'use strict';

var PanelEditPage = require('../../models/pages/PanelEditPage.js');

const gotoPanelEditPage = async ({ request, page, selectors, grafanaVersion }, use, testInfo) => {
  await use(async (args) => {
    const panelEditPage = new PanelEditPage.PanelEditPage({ page, selectors, grafanaVersion, request, testInfo }, args);
    await panelEditPage.goto();
    return panelEditPage;
  });
};

exports.gotoPanelEditPage = gotoPanelEditPage;
